'use strict';
let InstrumentDescriptor = require('./InstrumentDescriptor.js');
let InstrumentDescriptorBuilder = require('./InstrumentDescriptorBuilder.js');
class InternalInstrumentDescriptor extends InstrumentDescriptor {
    dxFeedSymbol;
    constructor() {
        super();
        this.dxFeedSymbol = null;
    }
    getDxFeedSymbol() {
        return this.dxFeedSymbol;
    }
    static createInstrumentDescriptor(descriptor) {
        let instrumentDescriptorBuilder;
        instrumentDescriptorBuilder = new InstrumentDescriptorBuilder();
        instrumentDescriptorBuilder.setOfferId(descriptor.getOfferId());
        instrumentDescriptorBuilder.setSymbol(descriptor.getSymbol());
        instrumentDescriptorBuilder.setSortOrder(descriptor.getSortOrder());
        instrumentDescriptorBuilder.setPriceStreamId(descriptor.getPriceStreamId());
        instrumentDescriptorBuilder.setSubscriptionStatus(descriptor.getSubscriptionStatus());
        return instrumentDescriptorBuilder.build();
    }
}
module.exports = InternalInstrumentDescriptor
